var startScale = 2;
var canvas = document.createElement("canvas");
var canvasContext = canvas.getContext("2d");
var baseWidth = 480;
var baseHeight = 400;
canvas.width = baseWidth * startScale;
canvas.height = baseHeight * startScale;
canvas.style.display = "block";
canvas.style.margin = "0px auto";
//http://www.dbp-consulting.com/tutorials/canvas/CanvasKeyEvents.html
canvas.setAttribute("tabindex", 0);
document.body.appendChild(canvas);
// Blog talking about how to scale the canvas on the various browsers.
// http://phoboslab.org/log/2012/09/drawing-pixels-is-hard
canvasContext.imageSmoothingEnabled = false;
canvasContext.webkitImageSmoothingEnabled = false;
canvasContext.mozImageSmoothingEnabled = false;

//====== INPUT ======
canvas.addEventListener("mousedown", doMouseDown, true);
function doMouseDown(event)
{
    //canvas_x = event.pageX;
}

var nextKeysPressed = {};
var keysPressed;
canvas.addEventListener("keypress", doKeyPress, true);
function doKeyPress(e)
{
	nextKeysPressed[e.keyCode] = true;
}

var keysDown = {};
canvas.addEventListener("keydown", doKeyDown, true);
function doKeyDown(e)
{
	keysDown[e.keyCode] = true;
}
canvas.addEventListener("keyup", doKeyUp, true);
function doKeyUp(e)
{
	keysDown[e.keyCode] = false;
}

function ascii(character)
{
    var result = character.charCodeAt(0);
    return result;
}


function particle(position, velocity, drag, life)
{
    this.position = position;
    this.velocity = velocity;
    this.drag = drag;
    this.life = 0;
    this.lifeMax = life;
}

var particles = [];
function addParticle(particle)
{
    particles[particles.length] = particle;
}

//
//====== UPDATE ======
//

function transitionFromDriftToRover()
{
    transitionSound.play();
    rocketInfo.phase = "rover";
    if(rocketInfo.roverType == "hover")
    {
        player.sprite = hoverRoverSprite;
    }
    else if(rocketInfo.roverType == "jump")
    {
        player.sprite = jumpRoverSprite;
    }
    else if(rocketInfo.roverType == "car")
    {
        player.sprite = carRoverSprite;
    }
    else
    {
        player.sprite = staticRoverSprite;
    }
    player.motion.drag = roverDrag;
}

var spaceHeldTime = 0;
function update(secondsElapsed) 
{
    keysPressed = nextKeysPressed;
    nextKeysPressed = {};
    
    if(keysPressed[ascii("q")])
    {
        debug = !debug;
    }
    
    if(debug && keysPressed[ascii("e")])
    {
        coinsCollected+= 5;
    }
    
    var gravity = 200;
    var acceleration = new v2(0, 0);
    var maxAcceleration = 500;
    switch(rocketInfo.phase)
    {
        case "ready":
            if(keysDown[ascii("W")] || keysDown[38])
            {
                thrustSound.play();
                rocketInfo.phase = "solidStart";
                //ignitionSound.play();
                
                gameSong.pause();
                rocketSong.currentTile = 0;
                rocketSong.play();
            }
            break;
        case "solidStart":
            var accelerationForce = (1 - (rocketInfo.solidStartSeconds / rocketInfo.totalSolidStartSeconds)) * maxAcceleration;
            acceleration = v2Multiply(angleToV2(player.rotation), accelerationForce);
            
            //var time = Math.min(rocketInfo.solidStartSeconds, secondsElapsed);
            rocketInfo.solidStartSeconds -= secondsElapsed;
            if(rocketInfo.solidStartSeconds <= 0)
            {
                rocketInfo.phase = "solidMain";
            }
            break;
        case "solidMain":
            var time = Math.min(rocketInfo.solidMainSeconds, secondsElapsed);
            rocketInfo.solidMainSeconds -= secondsElapsed;
            var accelerationForce = 0;
            if(rocketInfo.solidMainSeconds > 0)
            {
                accelerationForce = maxAcceleration;
            }
            else
            {
                thrustSound.pause();
            }
            acceleration = v2Multiply(angleToV2(player.rotation), accelerationForce);
            
            if(keysDown[ascii("S")] || keysDown[40])
            {
                rocketSong.pause();
                gameSong.currentTile = 0;
                gameSong.play();
            
                thrustSound.pause();
                transitionSound.play();
                rocketInfo.phase = "drift";
                driftSeconds = 0;
                player.sprite = parachuteSprite;
                player.motion.drag = parachuteDrag;
                player.rotation = playerSpawnRotation;
            }
            break;
        case "drift":
            driftSeconds += secondsElapsed;
            if((keysDown[ascii("S")] || keysDown[40]) && driftSeconds >= 2)
            {
                transitionFromDriftToRover();
            }
            if(keysDown[ascii("A")] || keysDown[37])
            {
                acceleration.x = -200;
            }
            if(keysDown[ascii("D")] || keysDown[39])
            {
                acceleration.x = 200;
            }
            break;
        case "rover":
            if(player.physics.onGroundLastFrame)
            {
                rocketInfo.hoverSeconds = rocketInfo.hoverSecondsMax;
            }
        
            var shouldPlayThrustSound = false;
            if(keysDown[ascii("W")] || keysDown[38])
            {
                if(player.physics.onGroundLastFrame && (rocketInfo.roverType == "jump"))// || rocketInfo.roverType == "hover"))
                {
                    acceleration.y -= 8000;
                }
                else if(rocketInfo.roverType == "hover" && rocketInfo.hoverSeconds > 0)
                {
                    shouldPlayThrustSound = true;
                    thrustSound.play();
                    rocketInfo.hoverSeconds -= secondsElapsed;
                    acceleration.y -= 400;
                }
            }
                
            if(!shouldPlayThrustSound)
            {
                thrustSound.pause();
            }
            
            if(rocketInfo.roverType != "static")
            {
                var accelerationMagnitue = 200;//50; // off the ground
                if(player.physics.onGroundLastFrame)
                {
                    accelerationMagnitue = 200;
                }
                if(keysDown[ascii("A")] || keysDown[37])
                {
                    acceleration.x = -accelerationMagnitue;
                }
                if(keysDown[ascii("D")] || keysDown[39])
                {
                    acceleration.x = accelerationMagnitue;
                }
            }
            break;
    }
    
    if(rocketInfo.phase == "solidStart" || rocketInfo.phase == "solidMain")
    {
        if(keysDown[ascii("A")] || keysDown[37])
        {
            player.rotation -= 0.0001 * v2Length(player.motion.velocity);
        }
        if(keysDown[ascii("D")] || keysDown[39])
        {
            player.rotation += 0.0001 * v2Length(player.motion.velocity);
        }
    }
    
    // Thruster sound controller
    {
        var fadeLength = 0.5;
        setVolumeFadeIn(thrustSound, fadeLength);
        if(!isNaN(thrustSound.duration))
        {
            if(thrustSound.paused)
            {
                if(!thrustSound2.paused)
                {
                    thrustSound2.pause();
                }
            }
            else
            {
                if(thrustSound2.paused)
                {
                    thrustSound2.play();
                }
            }
            var newTime = thrustSound.currentTime + (thrustSound.duration/2);
            if(newTime > thrustSound.duration)
            {
                newTime -= thrustSound.duration;
            }
            thrustSound2.currentTime = newTime;
            thrustSound2.volume = 1-thrustSound.volume;
            //setVolumeFadeIn(thrustSound2, fadeLength);
        }
    }
    
    // Gravity
    acceleration.y += 200;
    
    // This needs to happen before Move Entity is called.
    for(var i = 0; i < entities.length; i++)
    {
        if(entities[i].physics != null)
        {
            entities[i].physics.onGroundLastFrame = false;
        }
    }
    
    moveEntity(player, acceleration, secondsElapsed);
    
    // Respawn
    if(keysDown[ascii("S")] || keysDown[40])
    {
        spaceHeldTime += secondsElapsed;
    }
    else
    {
        spaceHeldTime = 0;
    }
    if(spaceHeldTime > 2)
    {
        // Respawn
        thrustSound.pause();
        respawnSound.play();
        player.position = v2Copy(playerSpawn);
        rocketInfo = new rocket();
        player.rotation = playerSpawnRotation;
        player.motion.velocity = new v2(0, 0);
        player.motion.drag = rocketDrag;
        
        if(coinsCollected < coinsForBooster2)
        {
            player.sprite = rocketSprite;
        }
        else if(coinsCollected < coinsForBooster3)
        {
            player.sprite = rocketSprite2;
        }
        else if(coinsCollected < coinsForBooster4)
        {
            player.sprite = rocketSprite3;
        }
        else
        {
            player.sprite = rocketSprite4;
        }
    }
    
    // Entity Updates
    for(i = 0;
        i < entities.length;
        i++)
    {
        var entity = entities[i];
        // Coins
        if(entity.type == "coin")
        {
            var distanceToPickupCoin = 25;
            if(v2Length(v2Subtract(player.position, entity.position)) < distanceToPickupCoin)
            {
                var index = entities.indexOf(entity);
                entities.splice(index, 1);
                coinsCollected++;
                if(coinsCollected == coinsForCar ||
                    coinsCollected == coinsForBooster2 ||
                    coinsCollected == coinsForJump ||
 //                   coinsCollected == coinsForGlider ||
                    coinsCollected == coinsForBooster3 ||
                    coinsCollected == coinsForJetpack ||
                    coinsCollected == coinsForBooster4)
                {
                    levelupSound.play();
                }
                else
                {
                    coinSound.play();
                }
            }
        }
    
        // Animation
        var sprite = entity.sprite;
        if(sprite != null && sprite.type == "animated")
        {
            sprite.animationSeconds += secondsElapsed;
            var numFrames = sprite.image.width / sprite.frameWidth;
            var totalAnimationSeconds = numFrames * (1/sprite.framesPerSecond);
            if(sprite.animationSeconds > totalAnimationSeconds)
            {
                sprite.animationSeconds -= totalAnimationSeconds;
            }
        }
    }
    
    // if(!thrustSound.paused)
    // {
        // var position = v2Copy(player.position);// todo move to the bottom
        // position.x += 2 * Math.random();
        // position.y += 2 * Math.random();
        // var velocity = v2Normalize(v2Multiply(player.velocity-1));
        // velocity.x += 0.5 * Math.random();
        // velocity.y += 0.5 * Math.random();
        // var newParticle = new particle(position, velocity, particleDrag, 3);
        // addParticle(newParticle);
    // }
    
    for(i = particles.length -1;
        i >= 0;
        i--)
    {
        var particle = particles[i];
        
        var acceleration = new v2Copy(particle.velocity);
        acceleration.x *= -particle.drag;
        acceleration.y *= -particle.drag;
        
        var positionDelta = v2Add(
            v2Multiply(acceleration, 0.5 * Math.pow(secondsElapsed, 2)), 
            v2Multiply(particle.velocity, secondsElapsed)); 
    
        particle.velocity = v2Add(
            particle.velocity, 
            v2Multiply(acceleration, secondsElapsed));
      
        particle.position = v2Add(particle.position, positionDelta);  
        
        particle.life += secondsElapsed;
        if(particle.life < particle.lifeMax)
        {
            particles.splice(i, 1);
        }
    }
    
    setVolumeFadeIn(rocketSong, 1);
    setVolumeFadeIn(gameSong, 1);
}

function setVolumeFadeIn(sound, fadeLength)
{        
    var volume = 1;
    if(sound.currentTime < fadeLength)
    {
        volume = sound.currentTime * (1 / fadeLength);
    }
    var timeToEnd = sound.duration - sound.currentTime;
    if(timeToEnd < fadeLength)
    {
        volume = timeToEnd * (1 / fadeLength);
    }
    sound.volume = volume;
}

function handleCollision(a, b)
{
    // Auto transition from drift to rover
    if(a == player || b == player)
    {
        if(rocketInfo.phase == "drift")
        {
            transitionFromDriftToRover();
        }
    }
}

function moveEntity(entity, acceleration, secondsElapsed)
{
    acceleration.x += entity.motion.velocity.x * -player.motion.drag.x;
    acceleration.y += entity.motion.velocity.y * -player.motion.drag.y;
    
    var positionDelta = v2Add(
        v2Multiply(acceleration, 0.5 * Math.pow(secondsElapsed, 2)), 
        v2Multiply(entity.motion.velocity, secondsElapsed)); 
    
    entity.motion.velocity = v2Add(
        entity.motion.velocity,
        v2Multiply(acceleration, secondsElapsed));
        
    var distanceRemaining = entity.motion.distanceLimit;
    if(distanceRemaining == 0)
    {
        distanceRemaining = 10000;
    }
    
    for(var i = 0;
        i < 4;
        ++i)
    {
        var tMin = 1;
        var positionDeltaLength = v2Length(positionDelta);
        if(positionDeltaLength > 0)
        {
            if(positionDeltaLength > distanceRemaining)
            {
                tMin = (distanceRemaining / positionDeltaLength);
            }
        
            // Note(ian): The 0, 0 is arbitrary.
            var wallNormal = new v2(0, 0);
            var hitEntity = null;
            var desiredPosition = v2Add(entity.position, positionDelta);
                        
            // Todo(ian): We might want to do some sort of sim region or broad phase here so that we don't have to check every entity in the game.
            for(var j = 0;
                j < entities.length;
                j++)
            {
                var testEntity = entities[j];
                if(testEntity.physics != null && testEntity != entity)
                {
                    var diameterW = testEntity.physics.size.x + entity.physics.size.x;
                    var diameterH = testEntity.physics.size.y + entity.physics.size.y;
                    var minCorner = v2Multiply(new v2(diameterW, diameterH), -0.5);
                    var maxCorner = v2Multiply(new v2(diameterW, diameterH), 0.5);
                    var rel = v2Subtract(entity.position, testEntity.position);
                    
                    var testResult = TestWall(minCorner.x, rel.x, rel.y, positionDelta.x, positionDelta.y, tMin, minCorner.y, maxCorner.y);
                    tMin = testResult.newTMin;
                    if(testResult.hit)
                    {
                        wallNormal = new v2(-1, 0);
                        hitEntity = testEntity;
                    }
            
                    var testResult = TestWall(maxCorner.x, rel.x, rel.y, positionDelta.x, positionDelta.y, tMin, minCorner.y, maxCorner.y);
                    tMin = testResult.newTMin;
                    if(testResult.hit)
                    {
                        wallNormal = new v2(1, 0);
                        hitEntity = testEntity;
                    }
            
                    var testResult = TestWall(minCorner.y, rel.y, rel.x, positionDelta.y, positionDelta.x, tMin, minCorner.x, maxCorner.x);
                    tMin = testResult.newTMin;
                    if(testResult.hit)
                    {
                        wallNormal = new v2(0, -1);
                        hitEntity = testEntity;
                        entity.physics.onGroundLastFrame = true;
                    }
            
                    var testResult = TestWall(maxCorner.y, rel.y, rel.x, positionDelta.y, positionDelta.x, tMin, minCorner.x, maxCorner.x);
                    tMin = testResult.newTMin;
                    if(testResult.hit)
                    {
                        wallNormal = new v2(0, 1);
                        hitEntity = testEntity;
                    }
                }
            }
            
            entity.position = v2Add(entity.position, v2Multiply(positionDelta, tMin));
            distanceRemaining -= tMin * positionDeltaLength;
            if(hitEntity != null)
            {
                positionDelta = v2Subtract(desiredPosition, entity.position);
                
                handleCollision(entity, hitEntity);
                
                // Note(ian): Ignore this code for objects that handle collisions but don't prevent movement.  Also might want to record the contant and ignore it until contact breaks.
                positionDelta = v2Subtract(positionDelta,
                    v2Multiply(wallNormal, v2Inner(positionDelta, wallNormal)));
                entity.motion.velocity = v2Subtract(entity.motion.velocity,
                    v2Multiply(wallNormal, v2Inner(entity.motion.velocity, wallNormal)));
            }
            else
            {
                break;
            }
        }
        else
        {
            break;
        }
    }
    
    if(entity.motion.distanceLimit != 0)
    {
        entity.motion.distanceLimit = distanceRemaining;
    }
}

// Note(ian): These parameter names are only correct for 1 of the 4 calls.
function TestWall(WallX, RelX, RelY, PlayerDeltaX, PlayerDeltaY, tMin, MinY, MaxY)
{
    var Hit = false;
    var newTMin = tMin;
    
    var tEpsilon = 0.001;
    if(PlayerDeltaX != 0)
    {
        var tResult = (WallX - RelX) / PlayerDeltaX;
        var Y = RelY + tResult*PlayerDeltaY;
        if((tResult >= 0) && (tMin > tResult))
        {
            if((Y >= MinY) && (Y <= MaxY))
            {
                newTMin = Math.max(0, tResult - tEpsilon);
                Hit = true;
            }
        }
    }

    return {
        hit: Hit,
        newTMin : newTMin
        };
}

function approach(start, destination, rate)
{
    if(start < destination)
    {
        return Math.min(start + rate, destination);
    }
    else
    {
        return Math.max(start - rate, destination);
    }
}

