function draw()
{
    var fillColour = "#05b9db";
    var fillRate = -((playerSpawn.y - player.position.y)/playerSpawn.y);
    canvasContext.fillStyle = shadeBlend(fillRate, fillColour, "#000000");
    canvasContext.fillRect(0,0,canvas.width,canvas.height);

    var cameraOffset = v2Multiply(camera.target.position, camera.scale);
    cameraOffset = v2Subtract(cameraOffset, new v2(canvas.width/2, canvas.height/2));
    camera.offset = cameraOffset;
    
    for(i = 0;
        i < mapData.layers.length;
        i++)
    {
        var layer = mapData.layers[i];
        for(var tileX = 0;
            tileX < mapData.width;
            tileX++)
        {
            for(var tileY = 0;
                tileY < mapData.height;
                tileY++)
            {
                // Todo(ian): Scale and offset this properly.
                var spriteID = layer.data[tileX + (tileY * mapData.width)];
                if(spriteID != 0)
                {
                    var x = tileX * mapData.tileWidth;
                    var y = tileY * mapData.tileHeight;
                    x = (x * camera.scale) - camera.offset.x;
                    y = (y * camera.scale) - camera.offset.y;
                    var tile = mapData.tiles[spriteID];
                    canvasContext.drawImage(tile.image, x, y, mapData.tileWidth * camera.scale, mapData.tileHeight * camera.scale);
                }
            }
        }
    }
    
    // todo(ian): Order by Y value before drawing.
    entities.sort(
        function (a, b)
        {
            return a.position.y - b.position.y;
        });
    
    for(i = 0;
        i < entities.length;
        i++)
    {
        drawEntity(entities[i]);
    }
    
     // backing for coins and text
    var backingHeight = 20;
    drawRectangle2(new v2(0, baseHeight - backingHeight), new v2(baseWidth, backingHeight), "#404040", false);
        
    var fontHeight = 16;
    var coinsText = coinsCollected + " / " + totalCoins;
    drawText(new v2(10, baseHeight - fontHeight - 4), coinsText, fontHeight, "#ffffff");
    
    var activePhrase = "";
    switch(rocketInfo.phase)
    {
        case "ready":
            activePhrase = "press UP to ignite solid rocket boosters";
            break;
        case "solidMain":
            activePhrase = "press DOWN to open the parachute";
            break;
        case "drift":
            activePhrase = "press DOWN to detach the parachute";
            break;
        case "rover":
            activePhrase = "hold DOWN for next launch";
            break;
    }
    if(activePhrase != "")
    {
        var fontHeight = 10;
        canvasContext.font = fontHeight + "px " + font; // note(ian): Must set this for measureText to work.
        var x = (baseWidth - canvasContext.measureText(activePhrase).width) / 2;
        var y = baseHeight - 6 - fontHeight;
        drawText(new v2(x, y), activePhrase, fontHeight, "#FFFFFF")
    }
    
    var medalPhrase = "";
    var medalSpacing = (medalbuggyGoldSprite.image.height / camera.scale) + 2;
    var medalY = baseHeight - medalSpacing;
    var medalX = baseWidth - medalSpacing;
    
    for(var i = 0; i < medals.length; i++)
    {
        if(coinsCollected >= medals[i].cost)
        {
            drawTexture(medals[i].sprite.image, medalX, medalY);
            medalY -= medalSpacing;
            if(medalPhrase == "")
            {
                medalPhrase = medals[i].phrase;
            }
        }
    }
    
    if(medalPhrase != "")
    {
        var fontHeight = 9;
        canvasContext.font = fontHeight + "px " + font; // note(ian): Must set this for measureText to work.
        var position = new v2(medalX, baseHeight - fontHeight - 6);
        position.x -= canvasContext.measureText(medalPhrase).width;
        drawText(position, medalPhrase, fontHeight, "#FFFFFF");
    }
        
    for(i = particles.length -1;
        i >= 0;
        i--)
    {
        var particle = particles[i];
        var lifePercent = particle.live / particle.lifeMax;
        var sprite = smokeSprite;
        if(lifePercent > 0.25)
        {
            sprite = smokeSprite2;
        }
        if(lifePercent > 0.50)
        {
            sprite = smokeSprite3;
        }
        if(lifePercent > 0.75)
        {
            sprite = smokeSprite4;
        }
        drawSprite(sprite, particle.position, 0);
    }
}

// draws from center point
function drawRectangle(center, size, color)
{
    color = color || 'magenta';
    var halfSize = v2Divide(size, 2);
    var topLeft = v2Subtract(center, halfSize);
    topLeft = v2Multiply(topLeft, camera.scale);
    topLeft = v2Subtract(topLeft, camera.offset);
    canvasContext.fillStyle = color;
    canvasContext.fillRect(topLeft.x, topLeft.y, size.x * camera.scale, size.y * camera.scale);
}

// draws from top left
function drawRectangle2(topLeft, size, color, offset)
{
    color = color || 'magenta';
    var start = v2Copy(topLeft);
    start = v2Multiply(start, camera.scale);
    if(offset)
    {
        start = v2Subtract(start, camera.offset);
    }
    canvasContext.fillStyle = color;
    canvasContext.fillRect(start.x, start.y, size.x * camera.scale, size.y * camera.scale);
}

function drawCircle(x, y)
{
    var radius = 2 * camera.scale;
    canvasContext.beginPath();
    x = (x * camera.scale) - camera.offset.x;
    y = (y * camera.scale) - camera.offset.y;
    //canvasContext.arc(x, canvasContext.canvas.height - y, radius, 0, 2 * Math.PI, false);
    canvasContext.arc(x, y, radius, 0, 2 * Math.PI, false);
    canvasContext.fillStyle = 'green';
    canvasContext.fill();
}

// note(ian): This is only for unscaled images!
function drawTexture(image, x, y)
{
    x = (x * camera.scale);// - camera.offset.x;
    y = (y * camera.scale);// - camera.offset.y;
    canvasContext.drawImage(image, x, y);//, image.width * camera.scale, image.height * camera.scale);
}

function drawEntity(entity)
{
    if(entity.sprite != null)
    {
        drawSprite(entity.sprite, entity.position, entity.rotation);
    }
    
    if(debug)
    {
        if(entity.physics != null)
        {
            drawRectangle(entity.position, entity.physics.size);
        }
        drawCircle(entity.position.x, entity.position.y);
    }
}

function drawSprite(sprite, position, rotation)
{   
    var sourceX = 0;
    var sourceY = 0;
    var width = sprite.image.width;
    var height = sprite.image.height;
    
    if(sprite.type == "animated")
    {
        var frame = Math.floor(sprite.animationSeconds * sprite.framesPerSecond);
        sourceX = sprite.frameWidth * frame;
        width = sprite.frameWidth;
        height = sprite.frameHeight;
    }
    
    var x = position.x * camera.scale;
    var y = position.y * camera.scale;
    
    x -= camera.offset.x;
    y -= camera.offset.y;
    
    // Note(ian): Make the origin the bottom center of the sprite.
    x -= width * camera.scale / 2;
    y -= height * camera.scale / 2;
    
    // TODO(ian): When rounding we should also consider the scale so we can have finer movement.
    x = Math.round(x);
    y = Math.round(y);
    
    canvasContext.save();
    canvasContext.translate(x + (width * camera.scale / 2), y + (height * camera.scale / 2));
    
    // Note(ian): Art is draw facing up instead of right so adjust here.
    canvasContext.rotate(rotation - (Math.PI / 2));
    
    // if(sprite.flipH)
    // {
        // canvasContext.save();
        // canvasContext.translate(canvas.width, 0);
        // canvasContext.scale(-1, 1);
        // x = canvas.width - x - (sprite.frameWidth * camera.scale);
    // }
    
    canvasContext.drawImage(sprite.image, sourceX, sourceY, width, height,
        -width * camera.scale / 2, 
        -height * camera.scale / 2, 
        width * camera.scale, height * camera.scale);
    
    canvasContext.restore();
    
    // if(sprite.flipH)
    // {
        // canvasContext.restore();
    // }
}

var font = "Arial";
function drawText(start, text, fontHeight, color)
{
    color = color || colorText;
    canvasContext.font = fontHeight + "px " + font;
    canvasContext.fillStyle = color;
    
    var position = new v2(start.x, start.y);
    position.y += fontHeight;
    
    canvasContext.save();
    canvasContext.scale(camera.scale, camera.scale);
    canvasContext.fillText(text, position.x, position.y);
    canvasContext.restore();
}

//
//====== INITIALIZE ======
//

function staticSprite(name)
{
    this.type = "static";
    this.image = new Image();
    this.image.src = name;
}

function animatedSprite(name, frameWidth, frameHeight, framesPerSecond)
{
    this.type = "animated";
    this.image = new Image();
    this.image.src = name;
    this.frameWidth = frameWidth;
    this.frameHeight = frameHeight;
    this.animationSeconds = 0;
    this.framesPerSecond = framesPerSecond;
    this.flipH = false;
}

function rectanglePhysics(width, height)
{
    this.size = new v2(width, height);
    //this.preventsMovement = true;
    this.onGroundLastFrame = false;
}

function entity(x, y, sprite)
{
    this.type = "";
    this.position = new v2(x, y);
    this.rotation = Math.PI / 2;
    this.sprite = sprite;
    this.motion = null;
    this.physics = null;
}

var particleDrag = new v2(4, 4);
var rocketDrag = new v2(2, 2);
var parachuteDrag = new v2(5, 7);
var roverDrag = new v2(2, 0.5);
function motion()
{
    this.velocity = new v2();
    this.maxVelocity = 4000;
    this.drag = rocketDrag;
    this.distanceLimit = 0;
}

var entities = [];
function addEntity(entity)
{
    entities[entities.length] = entity;
}

// submersible rover?
var coinsForBooster2 = 10;
var coinsForCar = 20;
//var coinsForGlider = 20;
var coinsForBooster3 = 30;
var coinsForJump = 40;
var coinsForBooster4 = 50;
var coinsForJetpack = 60;

function rocket()
{
    // note(ian): You can only hover when you have the hover rover.
    this.hoverSecondsMax = 1;
    this.hoverSeconds = this.hoverSecondsMax;
    
    this.solidStartSeconds = 5;
    this.totalSolidStartSeconds = this.solidStartSeconds;
    
    if(coinsCollected < coinsForBooster2)
    {
        this.solidMainSeconds = 4;
    }
    else if(coinsCollected < coinsForBooster3)
    {
        this.solidMainSeconds = 8;
    }
    else if(coinsCollected < coinsForBooster4)
    {
        this.solidMainSeconds = 12;
    }
    else
    {
        this.solidMainSeconds = 16;
    }
    
    this.capsuleType = "parachute";
    
    if(coinsCollected < coinsForCar)
    {
        this.roverType = "static";
    }
    else if(coinsCollected < coinsForJump)
    {
        this.roverType = "car";
    }
    else if(coinsCollected < coinsForJetpack)
    {
        this.roverType = "jump";
    }
    else
    {
        this.roverType = "hover";
    }
    
    this.phase = "ready";
}

var rocketSprite = new staticSprite("data/rocket.png");
var rocketSprite2 = new staticSprite("data/rocket2.png");
var rocketSprite3 = new staticSprite("data/rocket3.png");
var rocketSprite4 = new staticSprite("data/rocket4.png");
