// Note(ian): This code specifically loads maps made in the tiled editor.
function loadMap(mapJson)
{
    mapData.width = mapJson.width;
    mapData.height = mapJson.height;
    mapData.tileWidth = mapJson.tilewidth;
    mapData.tileHeight = mapJson.tileheight;
    mapData.layers = [];
    mapData.tiles = [];
    currentMapJson = mapJson;
    
    for(var i = 0; i < mapJson.tilesets.length; i++)
    {
        var tileset = mapJson.tilesets[i];
        var id = tileset.firstgid;
        mapData.tiles[id] = {};
        mapData.tiles[id].image = new Image();
        mapData.tiles[id].image.src = "data/" + tileset.image;
    }
    
    var layerZ = 0;
    for(var i = 0; i < mapJson.layers.length; i++)
    {
        var layer = mapJson.layers[i];
        if(layer.type == "tilelayer")
        {
            if(layer.name == "collisionTiles")
            {
                // Note(ian): It could be better to store and access these as tiles instead of making an entity for each tile.
                for(var tileX = 0;
                    tileX < mapData.width;
                    tileX++)
                {
                    for(var tileY = 0;
                        tileY < mapData.height;
                        tileY++)
                    {
                        // Todo(ian): Scale and offset this properly.
                        var spriteID = layer.data[tileX + (tileY * mapData.width)];
                        if(spriteID != 0)
                        {
                            var x = tileX * mapData.tileWidth;
                            var y = tileY * mapData.tileHeight;
                            var wall = new entity(x + (mapData.tileWidth/2), y + (mapData.tileHeight/2) , null);
                            wall.physics = new rectanglePhysics(mapData.tileWidth, mapData.tileHeight);
                            addEntity(wall);
                        }
                    }
                }
            }
            else
            {
                mapData.layers[mapData.layers.length] = layer;
                layerZ++;
            }
        }
        else if(layer.type == "objectgroup")
        {
            if(layer.name == "collisionObject")
            {
                for(var j = 0; j < layer.objects.length; j++)
                {
                    var object = layer.objects[j];
                    var wall = new entity(object.x + (object.width/2), object.y + (object.height/2) , null);
                    wall.physics = new rectanglePhysics(object.width, object.height);
                    addEntity(wall);
                }
            }
            else if(layer.name == "coins")
            {
                var coinSize = 10;
                for(var j = 0; j < layer.objects.length; j++)
                {
                    var object = layer.objects[j];
                    var coin = new entity(object.x, object.y, null);
                    coin.type = "coin";
                    coin.sprite = coinSprite;
                    addEntity(coin);
                    totalCoins++;
                }
            }
            else
            {
                for(var j = 0; j < layer.objects.length; j++)
                {
                    var object = layer.objects[j];
                    if(object.name == "playerSpawn")
                    {
                        playerSpawn = new v2(object.x, object.y);
                        player.position = v2Copy(playerSpawn);
                    }
                }
            }
        }
    }
}

//
//====== MATH ======
//

function v2(x, y)
{
    if(isNaN(x))
    {
        x = 0;
    }
    if(isNaN(y))
    {
        y = 0;
    }
    this.x = x;
    this.y = y;
}

function v2Multiply(one, scalar)
{
    var result = new v2();
    result.x = one.x * scalar;
    result.y = one.y * scalar;
    return result;
}

function v2MultiplyAssign(v2, scalar)
{
    v2.x *= scalar;
    v2.y *= scalar;
}

function v2Divide(one, scalar)
{
    var result = new v2();
    result.x = one.x / scalar;
    result.y = one.y / scalar;
    return result;
}

function v2DivideAssign(one, scalar)
{
    one.x = one.x / scalar;
    one.y = one.y / scalar;
}

function v2Add(one, two)
{
    var result = new v2();
    result.x = one.x + two.x;
    result.y = one.y + two.y;
    return result;
}

function v2AddAssign(one, two)
{
    one.x += two.x;
    one.y += two.y;
}

function v2Subtract(one, two)
{
    var result = new v2();
    result.x = one.x - two.x;
    result.y = one.y - two.y;
    return result;
}

function v2SubtractAssign(one, two)
{
    one.x -= two.x;
    one.y -= two.y;
}

function v2Length(a)
{
    var result = Math.pow(a.x, 2) + Math.pow(a.y, 2);
    result = Math.sqrt(result);
    return result;
}

function v2Inner(a, b)
{
    return Result = a.x*b.x + a.y*b.y;
}

function v2NormalizeAssign(a)
{
    if(a.x != 0 || a.y != 0)
    {
        v2DivideAssign(a, v2Length(a));
    }
}

function v2Normalize(a)
{
    var result = v2Copy(a);
    if(a.x != 0 || a.y != 0)
    {
        result = v2Divide(a, v2Length(a));
    }
    return result;
}

function v2Copy(v)
{
    return new v2(v.x, v.y);
}

function angleToV2(a)
{
    return new v2(-Math.cos(a), -Math.sin(a));
}

